INSERT [dbo].[fact_queries] ([queriesKey], [queryLabel], [query], [deleteFlag]) VALUES (6, N'getFactMetadata', N'select column_name as field,* from information_schema.columns where table_name like ? order by ordinal_position;', NULL)
INSERT [dbo].[fact_queries] ([queriesKey], [queryLabel], [query], [deleteFlag]) VALUES (9, N'getUserByPassword', N'select * from fact_teamMembers left join lkup_userRole on userRole = userRoleKey %WHERECLAUSE%', NULL)
INSERT [dbo].[fact_queries] ([queriesKey], [queryLabel], [query], [deleteFlag]) VALUES (10, N'getTeamMembers', N'select teamMembersKey as id, ''teamMember'' as form,firstName as "First Name", lastName as "Last Name", userName as "User Name", email as "Email" from fact_teamMembers', NULL)
INSERT [dbo].[fact_queries] ([queriesKey], [queryLabel], [query], [deleteFlag]) VALUES (11, N'getTable', N'select r.RegistrationKey as id,''registrationForm''as form, r.FirstName as "First Name",r.LastName as " Last Name", r.Status as "Status", r.Department as "Department" from FACT_Registration as r left join LKUP_Status as d on d.StatusKey = r.Status left join LKUP_Department as e on e.DepartmentKey = r.Department %WHERECLAUSE% and deleteFlag != 1 order by RegistrationKey desc', NULL)
INSERT [dbo].[fact_queries] ([queriesKey], [queryLabel], [query], [deleteFlag]) VALUES (12, N'getTableDisplay', N'select r.RegistrationKey as id,''registrationForm'' as form, 
r.FirstName as "First Name",r.LastName as " Last Name", d.StatusLabel as "Status",
 e.DepartmentLabel as "Department" from FACT_Registration as r left join LKUP_Status 
 as d on d.StatusKey = r.Status left join LKUP_Department 
as e on e.DepartmentKey = r.Department %WHERECLAUSE% order by RegistrationKey desc', NULL)
INSERT [dbo].[fact_queries] ([queriesKey], [queryLabel], [query], [deleteFlag]) VALUES (13, N'ageGenderGraph', N'select ageLabel as ''Age'', sum(case when gender = 2 then 1 else 0 end)
as ''Male'', sum(case when gender = 3 then 1 else 0 end)as ''Female'',
 sum(case when gender = 1 then 1 else 0 end)as ''Not Specified'' from LKUP_age left join 
FACT_reservations on age = ageKey  %WHERECLAUSE% group by ageLabel, ageOrder  order by ageOrder', NULL)
INSERT [dbo].[fact_queries] ([queriesKey], [queryLabel], [query], [deleteFlag]) VALUES (14, N'ageGenderReport', N'select genderLabel as "Gender", ageLabel as "Age", 
COUNT(a.FirstName) as "Patients" from FACT_reservations as a left join 
 LKUP_age as b on a.age = b.ageKey left join  LKUP_gender as c on a.gender = c.genderKey 
 %WHERECLAUSE% and genderLabel 
is not null group by genderKey,genderLabel, ageKey, ageLabel order by genderKey, ageKey', NULL)
INSERT [dbo].[fact_queries] ([queriesKey], [queryLabel], [query], [deleteFlag]) VALUES (15, N'ageGenderReport', N'select g.GenderLabel as "Gender", a.AgeLabel as "Age", 
COUNT(a.FirstName) as "Patients" from FACT_Registration as a left join 
 LKUP_Age as a on a.AgeKey = a.Age left join  LKUP_Gender as g on g.GenderKey = a.Gender 
 %WHERECLAUSE% and g.GenderLabel 
is not null group by genderKey,genderLabel, ageKey, ageLabel order by genderKey, ageKey', NULL)
INSERT [dbo].[fact_queries] ([queriesKey], [queryLabel], [query], [deleteFlag]) VALUES (16, N'departmentStatus', N'select DepartmentLabel as ''Department'', 
sum(case when Status = 1 then 1 else 0 end)as ''In-Patient'', 
sum(case when Status = 2 then 1 else 0 end)as ''Out-Patient''
  from lkup_Department left join FACT_Registration on 
Department = DepartmentKey %WHERECLAUSE% group by DepartmentLabel, DepartmentOrder order by DepartmentOrder
', NULL)
INSERT [dbo].[fact_queries] ([queriesKey], [queryLabel], [query], [deleteFlag]) VALUES (17, N'getQueries', N'select queriesKey as id, ''query'' as form, queryLabel as "Query Label", query as "Query" from fact_queries', NULL)
